import ReactDOM from 'react-dom';

var count =0;
function UpdateTime(){
     count++;
     return(count);
}

ReactDOM.render(
    <>
    <h1>{count}</h1>
    <button onClick={UpdateTime()}>Click Me</button>
    </>,
    document.getElementById("root")
)
